Our campaign with @wavesforwater is now live! Find out how you can win a custom 2021 @harleydavidson Forty-Eight by visiting www.croig.co and help provide people with clean water along the way.

We also hope you enjoy this FPV footage by @airjourdanfpv while we were at @sosametalworks shop building the bike in a week. You can also find the full video along with the build progress on CROIG’s YouTube channel.

