A HUGE THANKS to everyone who donated to the #BuiltForGood campaign. Together, the CROIG community raised over $22,000 for @wavesforwater to help provide clean water to those in need around the world.

A big congratulations to @hardingsan Jeff Harding from Pittsburgh, Pennsylvania for winning the custom Harley café racer! We hope you’re excited to ride it.

Also, we’ve picked all secondary winners and have sent out notifications. If you’ve donated, check your email to see if you’ve won and confirm your prize.

Stay tuned for more #BuiltforGood content as we prepare for delivery of  the bike to the winner next month and again, THANK YOU for helping make a difference! This won’t be the last, but the beginning of many 🙏

